import React, { Component, useEffect, useState } from "react";
import Header from "../component/header";
import AuthService from "../services/auth.service";
import { useRouter } from "next/router";
import axios from "axios";
import Componentdidmount from "../component/componentdidmount";
import "../component/map/config";
import Googlemap from "../component/map/maploaderbook";

export default function mapbooking() {
  const [origin, setOrigin] = React.useState({
    lat: null,
    lng: null,
  });


  useEffect(() => {
    console.log(tablemap);
    tablemap
      .filter((event) => event.id === 2)
      .map((data) => (
        coordinatebook.push({lat: data.pick_up_latitude, lng: data.pick_up_longitude}),
        data.booking_drop_off_location.map((data) => (
          coordinatebook.push({lat: data.drop_off_latitude, lng: data.drop_off_longitude})
        ))
      ))
  }, [10]);

  function trylang() {
    console.log(coordinatebook);
  }
  return (
    <>
      <Header></Header>
      <Componentdidmount></Componentdidmount>
      <div className="container-fluid">
        <div className="divSidebar">
          <div className="divMenu">
            <div className="divIcon">
              <ul className="no-bullets">
                <li>
                  <img src="Image/home.png" style={{ width: "20px" }} onClick = {trylang}></img>
                </li>
                <li>
                  <img src="Image/truck.png" style={{ width: "20px" }}></img>
                </li>
                <li>
                  <img src="Image/call.png" style={{ width: "20px" }}></img>
                </li>
              </ul>
            </div>
          </div>
        </div>
        <div className = "row">
          <div className = "col-lg-12">
            <Googlemap></Googlemap>
          </div>
        </div>
      </div>
    </>
  );
}
